Late to the party, but I found the exercise fun =) I put my result in terms of the golden ratio phi (I saw the Fibonacci numbers and couldn't resist), pretty symmetry there:

A^n = 1/sqrt(5) { { phi^(n-1) - (1-phi)^(n-1) ,  phi^n - (1-phi)^n } ,  { phi^n - (1-phi)^n ,  phi^(n+1) - (1-phi)^(n+1) } }

Cheers
